import React from 'react';
import withRouter from 'react-router-dom/withRouter';
import makeStyles from '@material-ui/core/styles/makeStyles';
import Header from './Header';
import Grid from '@material-ui/core/Grid';
import SubHeader from './SubHeader';
import Card from '@material-ui/core/Card';
import CardMedia from '@material-ui/core/CardMedia';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import Python from '../assets/Python.svg';
import Java from '../assets/Java.svg';
import JavaScript from '../assets/JavaScript.svg';
import Django from '../assets/Django.svg';
import Flask from '../assets/Flask.svg';
import Material from '../assets/Material-ui.svg';
import ReactPic from '../assets/React.svg';

const useStyles = makeStyles({
    gridContainer: {
        paddingLeft: "2rem",
        paddingRight: "2rem",
        margin: 0,
        width: "100%",
    },
    media: {
        height: "20rem"
    },
  });

function SkillsPage() {
    const classes = useStyles();
    return (
        <React.Fragment>
            <Header header={'Skills'}/>
            <Grid container justify="center" spacing={4} className={classes.gridContainer}>
                <Grid item xs={12}>
                    <SubHeader SubHeader={'Languages'}/>
                </Grid>
            </Grid>
            <Grid container spacing={4} className={classes.gridContainer}>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={Python}
                        title="Python"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                Python
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={Java}
                        title="Java"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                Java
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={JavaScript}
                        title="JavaScript"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                JavaScript
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
            <Grid container justify="center" spacing={4} className={classes.gridContainer}>
                <Grid item xs={12}>
                    <SubHeader SubHeader={'Frameworks'}/>
                </Grid>
            </Grid>
            <Grid container spacing={4} className={classes.gridContainer}>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={Django}
                        title="Django"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                Django
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={Flask}
                        title="Flask"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                Flask
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
                <Grid item xs={3}>
                    <Card raised="true" className={classes.card}>
                        <CardMedia
                        className={classes.media}
                        image={ReactPic}
                        title="React"
                        />
                        <CardContent>
                            <Typography variant="h5">
                                React
                            </Typography>
                        </CardContent>
                    </Card>
                </Grid>
            </Grid>
        </React.Fragment>
    );
}


export default withRouter(SkillsPage);
